import React from 'react';
import { Typography, Container, Grid, Box, Paper, Button, Chip } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
  const skills = {
    Programming: [
      'Java', 'C#', 'C++', 'Python', 'Golang', 'JavaScript', 'TypeScript'
    ],
    Web: [
      'ReactJS', 'Node.js', 'REST APIs', 'HTML', 'CSS'
    ],
    Backend: [
      'Java (Spring Boot)', 'Kafka', 'Redis', 'Microservices'
    ],
    Cloud: [
      'Azure', 'CI/CD', 'Docker (basic)'
    ],
    Databases: [
      'MySQL', 'MongoDB', 'NoSQL', 'SQL'
    ],
    Concepts: [
      'Data Structures & Algorithms', 'Object-Oriented Programming', 'System Design (basic)'
    ],
    Tools: [
      'VS Code', 'Git', 'Linux', 'Postman', 'MATLAB', 'Windows'
    ]
  };

  const SkillChip = ({ skill }) => (
    <Chip
      label={skill}
      size="small"
      sx={{
        m: 1,
        borderRadius: '50%',
        transition: 'transform 0.2s',
        '&:hover': {
          transform: 'scale(1.05)',
        },
      }}
    />
  );

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {/* Name and Introduction Section */}
      <Box sx={{ textAlign: 'center', mb: 8 }}>
        <Typography variant="h2" component="h1" gutterBottom>
          Your Name
        </Typography>
        <Typography variant="h5" color="text.secondary" paragraph>
          Full Stack Developer | Problem Solver | Tech Enthusiast
        </Typography>
        <Typography variant="body1" paragraph>
          I'm a passionate developer with expertise in building scalable web applications.
          I love creating beautiful, responsive, and user-friendly interfaces.
        </Typography>
      </Box>

      {/* Navigation Links */}
      <Box sx={{ mb: 8 }}>
        <Grid container spacing={2} justifyContent="center">
          <Grid item>
            <Button
              component={Link}
              to="/experience"
              variant="contained"
              color="primary"
              size="large"
            >
              Experience
            </Button>
          </Grid>
          <Grid item>
            <Button
              component={Link}
              to="/projects"
              variant="contained"
              color="primary"
              size="large"
            >
              Projects
            </Button>
          </Grid>
        </Grid>
      </Box>

      {/* Skills Section */}
      <Paper sx={{ p: 4, mb: 8 }}>
        <Typography variant="h4" gutterBottom>
          Skills
        </Typography>
        <Grid container spacing={4}>
          {Object.entries(skills).map(([category, skillList]) => (
            <Grid item xs={12} sm={6} key={category}>
              <Typography variant="h6" gutterBottom>
                {category}
              </Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap' }}>
                {skillList.map((skill) => (
                  <SkillChip key={skill} skill={skill} />
                ))}
              </Box>
            </Grid>
          ))}
        </Grid>
      </Paper>

      {/* Certifications Section */}
      <Paper sx={{ p: 4 }}>
        <Typography variant="h4" gutterBottom>
          Certifications
        </Typography>
        <ul>
          <li>React Developer Certification</li>
          <li>JavaScript Essentials</li>
          <li>Full Stack Development</li>
        </ul>
      </Paper>
    </Container>
  );
};

export default Home;
